    this.findByName = function(searchKey, callback) {
        this.db.transaction(
            function(tx) {

                var sql = "SELECT e.id, e.firstName, e.lastName, e.title, count(r.id) reportCount " +
                    "FROM member e LEFT JOIN member r ON r.managerId = e.id " +
                    "WHERE e.firstName || ' ' || e.lastName LIKE ? " +
                    "GROUP BY e.id ORDER BY e.lastName, e.firstName";

                tx.executeSql(sql, ['%' + searchKey + '%'], function(tx, results) {
                    var len = results.rows.length,
                        members = [],
                        i = 0;
                    for (; i < len; i = i + 1) {
                        members[i] = results.rows.item(i);
                    }
                    callback(members);
                });
            },
            function(error) {
                alert("Transaction Error: " + error.message);
            }
        );
    }

    this.findById = function(id, callback) {
        this.db.transaction(
            function(tx) {

                var sql = "SELECT e.id, e.name, e.company, e.contact " +
                    "FROM member e " +
                    "WHERE e.id=:id";

                tx.executeSql(sql, [id], function(tx, results) {
                    callback(results.rows.length === 1 ? results.rows.item(0) : null);
                });
            },
            function(error) {
                alert("Transaction Error: " + error.message);
            }
        );
    };

    this.findAllChapters = function(callback) {
        this.db.transaction(
            function(tx) {

                var sql = "SELECT e.id, e.chaptername, e.venue, e.city, e.area, e.meetingday, e.meetingtime " +
                    "FROM chapter e";

                tx.executeSql(sql, [], function(tx, results) {
                    var len = results.rows.length,
                        chapters = [],
                        i = 0;
                    for (; i < len; i = i + 1) {
                        chapters[i] = results.rows.item(i);
                    }
                    callback(chapters);
                });
            },
            function(error) {
                alert("Transaction Error: " + error.message);
            }
        );
    }

    this.findChapterMembersById = function(id, callback) {
        this.db.transaction(
            function(tx) {

                var sql = "SELECT e.id, e.chaptername, e.venue, e.city, e.area, e.meetingday, e.meetingtime, m.id as memberid, m.name, m.chapterid, m.contact, m.company " +
                    "FROM chapter e " +
                    "LEFT JOIN member m ON m.chapterid = e.id " +
                    "WHERE e.id=:id";

                tx.executeSql(sql, [id], function(tx, results) {
                    var len = results.rows.length,
                        members = [],
                        i = 0;
                    for (; i < len; i = i + 1) {
                        members[i] = results.rows.item(i);
                    }
                    callback(members);
                });
            },
            function(error) {
                alert("Transaction Error: " + error.message);
            }
        );
    };

